import axios from 'axios'

export async function getAllMeetList(){
    const apiUrl = 'http://127.0.0.1:8000/api/apiOverview';
    let request = await axios.get(apiUrl);
    request.then(response => {
        data = response.data
        }
    );
    return(data);
}
